import InputCheckbox from "../../../../UI/InputCheckbox/InputCheckbox";

import style from "./OptionCheckbox.module.css";

function OptionCheckboxExpense(props) {
  return (
    <div className={style.checkbox}>
      <p className={style["subTitle--blue"]}>Customize Your Chart</p>
      <div className={style["checkbox__container"]}>
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="food"
          label="Food"
          defaultChecked={true}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="transportation"
          label="Transportation"
          defaultChecked={true}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="clothing"
          label="Clothing"
          defaultChecked={true}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="entertainment"
          label="Entertainment"
          defaultChecked={true}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="housing"
          label="Housing"
          defaultChecked={true}
        />
        <InputCheckbox
          classContainer={style["input__container"]}
          classCheck={style.check}
          classInput={style.input}
          classLabel={style.label}
          id="others"
          label="Others"
          defaultChecked={true}
        />
      </div>
    </div>
  );
}

export default OptionCheckboxExpense;
